  false,\n\t\"url\": null,\n\t\"notes\": \"This BPA-funded study provides estimates
  of smolt survival and travel time through individual reaches and reaches combined
  in the Snake and Columbia Rivers hydropower system each year. Smolts are PIT tagged
  at Lower Granite Dam and combined with smolts tagged by other researchers in the
  basin to estimate survival and travel time. This project also operates the PIT tag
  trawl in the Columbia River estuary which provides detection data necessary to estimate
  survival through the final reach to below Bonneville Dam. This information is used
  to help the region focus on where passage improvements are needed to improve survival
  and travel time through the Federal Columbia River Power System (FCRPS).nnAnnual
  reach survival estimates.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
